import {StyleSheet} from "react-native";

const css = StyleSheet.create({
    container: {
      flex: 1,
      backgroundColor: '#fff',
      alignItems: 'center',
      justifyContent: 'center',
    },
    textPage:{
        backgroundColor:'blue',
        padding: 20
    },
    area__tab:{
        backgroundColor: '#fff',
        fontSize: 20,
        fontWeight: 'bold',
        color:'#333'
    }

  });
  export {css};
